import React from 'react';
import Skills from './Skills';

const MainContent = () => {
    return (
        <div className="main-content">
            <Header />
            <Jumbotron />
            <Skills />
            <Carousell />
            <Boxes />
            <Footer />
        </div>
    );
};

export default MainContent;
